def CountAlphaDigSpl(s: Sequence[str]) -> Tuple[int, int, int]:
    alphabets = 0
    digits = 0
    special = 0
    for c in s:
        if len(c) != 1:
            raise ValueError("Each element in s must be a single character string.")
        if c.isalpha():
            alphabets += 1
        elif c.isdigit():
            digits += 1
        else:
            special += 1
    return alphabets, digits, special
