def AsciiValueString(str1):
    if not isinstance(str1, (list, tuple, str)):
        raise TypeError("str1 must be a sequence of characters")
    if len(str1) > 0:
        # Accept both 'char' (as str of length 1) and int (ord value)
        c = str1[0]
        if isinstance(c, str):
            if len(c) != 1:
                raise ValueError("Elements must be single characters")
            return ord(c)
        elif isinstance(c, int):
            # Already an int, assume it's the ASCII value
            return c
        else:
            raise TypeError("Elements of str1 must be characters or ints")
    else:
        return 0
