def CountVowels(testStr):
    if len(testStr) < 2:
        raise ValueError("Precondition violated: |testStr| >= 2")
    res = 0
    vowList = ['a', 'e', 'i', 'o', 'u']
    idx = 1
    while idx < len(testStr):
        if testStr[idx].lower() in vowList:
            res += 1
        idx += 1
    return res
